
const image_to_text_example_image_as_base64 = "";
//\ \:"

if(window.camera_streaming){
	window.stop_camera();
}
document.body.classList.remove('hide-camera-still');

const decoded_image_to_text_example_image = atob(image_to_text_example_image_as_base64);
//console.log("decoded_image_to_text_example_image: ", decoded_image_to_text_example_image);

really_create_file(false,decoded_image_to_text_example_image,'Child_labor.jpg')
.then((value) => {
	//console.log("example image should now be added. value: ", value);
	
	setTimeout(() => {
		do_prompt({'assistant':'image_to_text'},get_translation('Write_a_detailed_description_of_this_image'));
		window.scroll_chat_to_bottom();
		setTimeout(() => {
			//console.log("image_to_text describer example image loaded?");
			do_prompt({'assistant':'image_to_text'},get_translation('What societal issue does the image signify?'));
			window.scroll_chat_to_bottom();
		},1000);
	},3000);
	
})
.catch((err) => {
	console.error("caught error creating example image: ", err);
})
